recommandationVideos.Description:
Minun mielestä Tik Tok on ihan älyttömän hauska alusta jossa jokainen ihminen voi käyttää omaa luovuuttaan niin paljon kuin haluavat. Toiset tekevät upeita tanssivideoita ja toiset taas ihan superhauskoja sketsejä. :D 

Mä jäin koukkuun Tik Tokkiin lopullisesti syksyllä ja tajusin et hei, tämähän on instagramia hauskempi alusta koska jokainen voi olla juuri sellainen kun on, ei tarvitse esittää mitään muuta kuin omaa itseään. 

Päätettiin tehdä sit mun tiimin kans TikTok haaste jossa tehdään jokainen vuorollaan oma versio jostakin toisen TikTokkaajan tekemästä videosta. Ja tsiisus, kyllä sieltä valikoitui todella erikoiset versiot. :D 

Mikä sun mielestä oli paras versio? 

